measurements.description:
One flat flower on a 23-cm inflorescence;
	dorsal sepal flat and wide, white veined green, blushed pink, darker distally;
	synsepal white veined green;
	petals slightly reflexed top edge, light green veined darker green, blushed pink-brown distal edges, a few distinct dark 
	pink dots along hirsuite top edges; 
	pouch light green, overlaid mahogany, darker veins; 
	staminode green, darker markings; substance medium; texture glossy.
